    "2016-06-09T07:18:02.846034",nt"name": "wetlands-deepwater-habitats-mo-2012-east-west-gateway-wetland-importance-gdb",nt"isopen":
    false,nt"url": null,nt"notes": "We used LiDAR data to improve the wetland
    classification for the Missouri River floodplain and a portion of the Mississippi
    River floodplain upstream of the confluence with the Missouri. The process involved
    used of LiDAR data to create better digital elevation models, vegetation height
    information, and image objects for mapping. Wetland classification results were
    designed to mimic Cowardinu00e2u0080u0099s classification scheme (including the
    water regime modifier), which in turn is used by regulatory agencies. We also improved
    wetland restoration potential information, mainly by improving the water regime
    index (e.g. identifying low-lying areas at fine resolution). We defined water regime
    in a way that is likely to identify too many, rather than too few, areas as u00e2u0080u009cwet.u00e2u0080u009d
    Even given this caveat, we identified less area as wetland versus the earlier version
    based on coarser information. Earlier results showed many false positives for wetland,
    mainly due to the lack of fine-resolution information on water regime and mistakes
    in land cover mapping that were corrected with LiDAR data.",nt"license_title":
